import { Link } from "react-router-dom";

const HomePage = () => {

	return (
		<div>
			<h1>Welcome to ft_transcendence</h1>
			<br></br>
			<Link to="/profile">U</Link>
			<br></br>
			<br></br>
			<Link to="/pong">Play pong</Link>
			<br></br>
			<br></br>
			<Link to="/profile">Signup</Link>
			<br></br>
		</div>
	);

};

export default HomePage;
